ll encode(string s) {
    if (s == "Akazukin Chacha") return 100001;
    if (s == "Extreme Hearts") return 100002;
    if (s == "Konohakaseki no Natsu") return 100003;
    HashRange h;
    h.add(s);
    return h.hash(0, s.size())[0];
}

string encode2(ll x) {
    string res;
    for (int i = 0; i < 4; ++i) {
        char c = 63+x%64;
        if (c == '\\') c = '(';
        if (c == '"') c = ')';
        res += c;
        x /= 64;
    }
    assert(x == 0);
    return res;
}

map<string, int> pos;

