    cin.tie(0)->sync_with_stdio(0);
    for (int i = 0; i < str.size(); i += 4) {
        pos[str.substr(i, 4)] = i/4;
    }
    // ifstream cin("fun.in");
    // ofstream cout("fun2.out");
    int n, m; cin >> n >> m;
    cin.get();
    for (int i = 0; i < n; ++i) {
        string s;
        getline(cin, s);
        cout << (pos[encode2(encode(s))]+1)%m << endl;
    }
